import React from 'react';
import axios from "axios";


export default class CheckOut extends React.Component {

    state = { visitors: [] };

    getVisitors() {
        axios.get('http://127.0.0.1:8000/api/checkins/')
            .then(res => {
                this.setState({ visitors: res.data });
            })
    }

    componentDidMount(){
        this.getVisitors();
    }

    render() {
        let { visitors } = this.state;

        return (
            <div>
                <h2>Check Out</h2>
                <div>{{visitors}}</div>
            </div >
        );
    }
}
